def solve(s):
    letters = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ'
    reversed_case = ''
    for char in s:
        if char.isalpha():
            if char.islower():
                reversed_case += char.upper()
            else:
                reversed_case += char.lower()
        else:
            reversed_case += char
    if all(char not in letters for char in s):
        return s[::-1]
    return reversed_case
